export const iconMap = {
  close: CloseIcon,
  check: CheckIcon,
  add: AddIcon,
  addBasic: Add,
  remove: RemoveIcon,
  warning: WarningIcon,
  menu: MenuIcon,
  forum: ForumIcon,
  mail: MailIcon,
