  app: Apps,
  personAdd: PersonAdd,
  offlinePin: OfflinePin,
  dollarSign: DollarSign,
  contactMail: ContactMail,
  people: People,
  developerMode: DeveloperMode,
  save: Save,
  supervisorAccount: SupervisorAccount,
  error: ErrorIcon,
  checkCircle: CheckCircle,
  radioButtonChecked: RadioButtonChecked,
  flash: FlashOn,
  report: Report,
  deleteForever: DeleteForever,
  deleteSweep: DeleteSweep,
  groupAdd: GroupAdd,
  edit: Edit,
  trendingUp: TrendingUp,
  trendingDown: TrendingDown,
  trendingFlat: TrendingFlat,
  expandMore: ExpandMoreIcon,
  backupRestore: SettingsBackupRestore,
  filter: FilterList,
  arrowUp: ArrowUpward,
  arrowDown: ArrowDownward,
  domain: Domain,
  info: Info,
  attachFile: AttachFile,
  download: CloudDownload,
  health: LocalHospital,
  help: Help,
  monetizationOn: MonetizationOn,
  chart: InsertChart,
  image: Image,
  delete: Delete,
  phoneLink: Phonelink,
  openInNew: OpenInNew,
  settings: Settings,
  event: Event,
  computer: Computer,
  notifications: Notifications,
  snooze: Snooze,
  dragHandle: DragHandle,
  priorityHigh: PriorityHigh,
};

const Icon = React.forwardRef((
  {
    type,
    size,
    tooltip,
    tooltipPlacement,
    style = {},
    badgeContent,
    ...props
  },
  ref,
) => {
  const iconStyle = {
    ...style,
    ...(size ? { width: size, height: size } : {}),
  };

  if (type !== null && typeof type === 'object') {
    return React.cloneElement(type, { style: iconStyle });
  }

  const MyIcon = iconMap[type];

  if (!MyIcon) {
    throw new Error(`invalid icon type: ${type}`);
  } else if (MyIcon.component) {
    return <MyIcon.component {...MyIcon.props} {...props} {...iconStyle} />;
  }

  let icon = <MyIcon ref={ref} style={iconStyle} {...props} />;

  if (tooltip) {
    icon = (
      <Tooltip
        placement={tooltipPlacement}
        title={tooltip}
        enterTouchDelay={0}
      >
        {icon}
      </Tooltip>
    );
  }

  if (badgeContent) {
    icon = (
      <Badge badgeContent={badgeContent} color="error">
        {icon}
      </Badge>
    );
  }

  return icon;
});

Icon.propTypes = {
  size: PropTypes.number,
  type: PropTypes.node.isRequired,
};

Icon.defaultProps = {
  size: undefined,
};

export default Icon;

